// import logo from './logo.svg';
import './App.css';
import Navbar from './components/Navbar';

function App() {
  return (
    <>
      <Navbar title="TradeMAX" />
      <div id="banner" tabindex="-1" className="flex fixed z-50 gap-8 justify-between items-start py-3 px-4 w-full bg-gray-50 border border-b border-gray-200 sm:items-center dark:border-gray-700 lg:py-4 dark:bg-gray-800">
        <p className="text-sm font-light text-gray-500 dark:text-gray-400">Supercharge your hiring by taking advantage of our</p>
      </div>
    </>
  );
}

export default App;
